import {
  repeaterData,
  RepeaterControl,
} from '../../../gutenberg-repeater-control/index.js';


const { __ } = wp.i18n;
const { registerBlockType } = wp.blocks;
const { RichText,InspectorControls } = wp.blockEditor;

const {
  PanelBody,
  PanelRow,
  ToggleControl,
  TextControl,
  TextareaControl,
  RadioControl,
} = wp.components;

const name = "gb/withdescriptiononbrand";

registerBlockType(name, {
  title: __("With Description On Brand", "GB"),
  icon: (
    <img src="data:image/png;base64," />
  ),
  category: "newsletter",
  attributes: {
    method: {
      type: "string",
      default: "GET",
    },
    action: {
      type: "string",
      default: "",
    },
    message: {
      type: "string",
      default: "",
    },
    subject: {
      type: "string",
      default: "",
    },
    to: {
      type: "string",
      default: "",
    },
    hidden: {
      type: "string|array",
      source: "attribute",
      selector: "select",
      attribute: "hidden",
      default: [],
    },
    contentt: { type: "string", default: `  ` },
    contentUA: { type: "string", default: `    ` },
    contentUB: { type: "string", default: `      ` },
    contentUC: { type: "string", default: `        ` },
    contentUD: { type: "string", default: `Sign up for our newsletter` },
    contentUE: { type: "string", default: `        ` },
    contentUF: {
      type: "string",
      default: `Anim aute id magna aliqua ad ad non deserunt sunt. Qui irure qui Lorem cupidatat commodo. Elit sunt amet fugiat.`,
    },
    contentUG: { type: "string", default: `      ` },
    contentUH: { type: "string", default: `      ` },
    contentUI: { type: "string", default: `        ` },
    contentUJ: { type: "string", default: `          ` },
    contentUK: { type: "string", default: `Email address` },
    contentUL: { type: "string", default: `          ` },
    contentUM: { type: "string", default: `          ` },
    contentUN: { type: "string", default: `Notify me` },
    contentUO: { type: "string", default: `        ` },
    contentUP: { type: "string", default: `        ` },
    contentUQ: {
      type: "string",
      default: `          We care about the protection of your data. Read our          `,
    },
    contentUR: { type: "string", default: ` Privacy Policy. ` },
    contentUS: { type: "string", default: `        ` },
    contentUT: { type: "string", default: `      ` },
    contentUU: { type: "string", default: `    ` },
    contentUV: { type: "string", default: `  ` },
    contentUW: { type: "string", default: `` },
  },
  edit: function (props) {
    const { attributes, setAttributes } = props;
    const { send } = attributes;

    return (
      <div className="bg-white">
         <InspectorControls>
          <PanelBody title="Email settings">
            <PanelRow>
              <ToggleControl
                label="Send email"
                checked={send}
                onChange={() => setAttributes({ send: !send })}
              />
            </PanelRow>
            {send ? (
              <div>
                <PanelRow>
                  <TextControl
                    label="To"
                    value={attributes.to}
                    onChange={(to) => setAttributes({to})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextControl
                    label="Subject"
                    value={attributes.subject}
                    onChange={(subject) => setAttributes({subject})}
                  />
                </PanelRow>
                <PanelRow>
                  <TextareaControl
                    label="Message"
                    value={attributes.message}
                    onChange={(message) => setAttributes({message})}
                  />
                </PanelRow>
              </div>
            ) : (
              ""
            )}
          </PanelBody>
          <PanelBody title="Form settings">
            <PanelRow>
              <RadioControl
                label="Method"
                selected={attributes.method}
                options={[
                  { label: "GET", value: "GET" },
                  { label: "POST", value: "POST" },
                ]}
                onChange={(method) => setAttributes({ method })}
              />
            </PanelRow>
            <PanelRow>
              <TextControl
                label="Action"
                onChange={(action) => setAttributes({ action })}
              />
            </PanelRow>

            <PanelRow>
              <b>Hidden fields</b>
            </PanelRow>
            <PanelRow>
              <RepeaterControl
                max={5}
                value={props.attributes.hidden}
                onChange={(val) => {
                  props.setAttributes({ hidden: val });
                }}
              >
                {(value, onChange) => {
                  return [
                    <TextControl
                      label="Name"
                      value={value.name}
                      onChange={(v) => {
                        value.name = v;
                        onChange(value);
                      }}
                    />,
                    <TextControl
                      label="Value"
                      value={value.val}
                      onChange={(v) => {
                        value.val = v;
                        onChange(value);
                      }}
                    />,
                  ];
                }}
              </RepeaterControl>
            </PanelRow>
          </PanelBody>
        </InspectorControls>
        <RichText
          value={attributes.contentt}
          default={"  "}
          onChange={(newtext) => setAttributes({ contentt: newtext })}
        />
        <div className="max-w-7xl mx-auto px-4 py-12 sm:px-6 lg:py-16 lg:px-8">
          <RichText
            value={attributes.contentUA}
            default={"    "}
            onChange={(newtext) => setAttributes({ contentUA: newtext })}
          />
          <div className="py-10 px-6 bg-indigo-700 rounded-3xl sm:py-16 sm:px-12 lg:p-20 lg:flex lg:items-center">
            <RichText
              value={attributes.contentUB}
              default={"      "}
              onChange={(newtext) => setAttributes({ contentUB: newtext })}
            />
            <div className="lg:w-0 lg:flex-1">
              <RichText
                value={attributes.contentUC}
                default={"        "}
                onChange={(newtext) => setAttributes({ contentUC: newtext })}
              />
              <h2 className="text-3xl font-extrabold tracking-tight text-white">
                <RichText
                  value={attributes.contentUD}
                  default={"Sign up for our newsletter"}
                  onChange={(newtext) =>
                    setAttributes({ contentUD: newtext })
                  }
                />
              </h2>
              <RichText
                value={attributes.contentUE}
                default={"        "}
                onChange={(newtext) => setAttributes({ contentUE: newtext })}
              />
              <p className="mt-4 max-w-3xl text-lg text-indigo-100">
                <RichText
                  value={attributes.contentUF}
                  default={
                    "Anim aute id magna aliqua ad ad non deserunt sunt. Qui irure qui Lorem cupidatat commodo. Elit sunt amet fugiat."
                  }
                  onChange={(newtext) =>
                    setAttributes({ contentUF: newtext })
                  }
                />
              </p>
              <RichText
                value={attributes.contentUG}
                default={"      "}
                onChange={(newtext) => setAttributes({ contentUG: newtext })}
              />
            </div>
            <RichText
              value={attributes.contentUH}
              default={"      "}
              onChange={(newtext) => setAttributes({ contentUH: newtext })}
            />
            <div className="mt-12 sm:w-full sm:max-w-md lg:mt-0 lg:ml-8 lg:flex-1">
              <RichText
                value={attributes.contentUI}
                default={"        "}
                onChange={(newtext) => setAttributes({ contentUI: newtext })}
              />
              <form className="sm:flex">
                <RichText
                  value={attributes.contentUJ}
                  default={"          "}
                  onChange={(newtext) =>
                    setAttributes({ contentUJ: newtext })
                  }
                />
                <label for="email-address" className="sr-only">
                  <RichText
                    value={attributes.contentUK}
                    default={"Email address"}
                    onChange={(newtext) =>
                      setAttributes({ contentUK: newtext })
                    }
                  />
                </label>
                <RichText
                  value={attributes.contentUL}
                  default={"          "}
                  onChange={(newtext) =>
                    setAttributes({ contentUL: newtext })
                  }
                />
                <input
                  id="email-address"
                  name="email-address"
                  type="email"
                  autocomplete="email"
                  required
                  className="w-full border-white px-5 py-3 placeholder-gray-500 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-indigo-700 focus:ring-white rounded-md"
                  placeholder="Enter your email"
                />
                <RichText
                  value={attributes.contentUM}
                  default={"          "}
                  onChange={(newtext) =>
                    setAttributes({ contentUM: newtext })
                  }
                />
                <button
                  type="submit"
                  className="mt-3 w-full flex items-center justify-center px-5 py-3 border border-transparent text-base font-medium rounded-md text-white bg-indigo-500 hover:bg-indigo-400 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-indigo-700 focus:ring-white sm:mt-0 sm:ml-3 sm:w-auto sm:flex-shrink-0"
                >
                  <RichText
                    value={attributes.contentUN}
                    default={"Notify me"}
                    onChange={(newtext) =>
                      setAttributes({ contentUN: newtext })
                    }
                  />
                </button>
                <RichText
                  value={attributes.contentUO}
                  default={"        "}
                  onChange={(newtext) =>
                    setAttributes({ contentUO: newtext })
                  }
                />
              </form>
              <RichText
                value={attributes.contentUP}
                default={"        "}
                onChange={(newtext) => setAttributes({ contentUP: newtext })}
              />
              <p className="mt-3 text-sm text-indigo-100">
                <RichText
                  value={attributes.contentUQ}
                  default={
                    "          We care about the protection of your data. Read our          "
                  }
                  onChange={(newtext) =>
                    setAttributes({ contentUQ: newtext })
                  }
                />
                <a href="#" className="text-white font-medium underline">
                  <RichText
                    value={attributes.contentUR}
                    default={" Privacy Policy. "}
                    onChange={(newtext) =>
                      setAttributes({ contentUR: newtext })
                    }
                  />
                </a>
                <RichText
                  value={attributes.contentUS}
                  default={"        "}
                  onChange={(newtext) =>
                    setAttributes({ contentUS: newtext })
                  }
                />
              </p>
              <RichText
                value={attributes.contentUT}
                default={"      "}
                onChange={(newtext) => setAttributes({ contentUT: newtext })}
              />
            </div>
            <RichText
              value={attributes.contentUU}
              default={"    "}
              onChange={(newtext) => setAttributes({ contentUU: newtext })}
            />
          </div>
          <RichText
            value={attributes.contentUV}
            default={"  "}
            onChange={(newtext) => setAttributes({ contentUV: newtext })}
          />
        </div>
        <RichText
          value={attributes.contentUW}
          default={""}
          onChange={(newtext) => setAttributes({ contentUW: newtext })}
        />
      </div>
    );
  },
  save: function (props) {
    const { attributes } = props;
    const arData = repeaterData(props.attributes.hidden, true);

    return (
      <div class="bg-white">
       <RichText.Content value={attributes.contentt}/>
        <div class="max-w-7xl mx-auto px-4 py-12 sm:px-6 lg:py-16 lg:px-8">
         <RichText.Content value={attributes.contentUA}/>
          <div class="py-10 px-6 bg-indigo-700 rounded-3xl sm:py-16 sm:px-12 lg:p-20 lg:flex lg:items-center">
           <RichText.Content value={attributes.contentUB}/>
            <div class="lg:w-0 lg:flex-1">
             <RichText.Content value={attributes.contentUC}/>
              <h2 class="text-3xl font-extrabold tracking-tight text-white">
               <RichText.Content value={attributes.contentUD}/>
              </h2>
             <RichText.Content value={attributes.contentUE}/>
              <p class="mt-4 max-w-3xl text-lg text-indigo-100">
               <RichText.Content value={attributes.contentUF}/>
              </p>
             <RichText.Content value={attributes.contentUG}/>
            </div>
           <RichText.Content value={attributes.contentUH}/>
            <div class="mt-12 sm:w-full sm:max-w-md lg:mt-0 lg:ml-8 lg:flex-1">
             <RichText.Content value={attributes.contentUI}/>
              <form 
              class="sm:flex"
              action={attributes.action}
              method={attributes.method}
              >
                 {arData.map((v) => {
                  return <input type="hidden" name={v.name} value={v.val} />;
                })}

               <RichText.Content value={attributes.contentUJ}/>
                <label for="email-address" class="sr-only">
                 <RichText.Content value={attributes.contentUK}/>
                </label>
               <RichText.Content value={attributes.contentUL}/>
                <input
                  id="email-address"
                  name="email-address"
                  type="email"
                  autocomplete="email"
                  required
                  class="w-full border-white px-5 py-3 placeholder-gray-500 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-indigo-700 focus:ring-white rounded-md"
                  placeholder="Enter your email"
                />
               <RichText.Content value={attributes.contentUM}/>
                <button
                  type="submit"
                  onclick={`sendEmail('${name}'); return false;`}
                  class="mt-3 w-full flex items-center justify-center px-5 py-3 border border-transparent text-base font-medium rounded-md text-white bg-indigo-500 hover:bg-indigo-400 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-offset-indigo-700 focus:ring-white sm:mt-0 sm:ml-3 sm:w-auto sm:flex-shrink-0"
                >
                 <RichText.Content value={attributes.contentUN}/>
                </button>
               <RichText.Content value={attributes.contentUO}/>
              </form>
             <RichText.Content value={attributes.contentUP}/>
              <p class="mt-3 text-sm text-indigo-100">
               <RichText.Content value={attributes.contentUQ}/>
                <a
                  href={
                    attributes.contentUR.match('(.*?)href="(.*?)"(.*?)')
                      ? attributes.contentUR.match(
                          '(.*?)href="(.*?)"(.*?)'
                        )[2]
                      : attributes.contentUR
                  }
                  class="text-white font-medium underline"
                >
                  {attributes.contentUR.match("(?<=<.+.>)(.*?)(?=<.*/.+.?>)")
                    ? attributes.contentUR.match(
                        "(?<=<.+.>)(.*?)(?=<.*/.+.?>)"
                      )[0]
                    : attributes.contentUR}
                </a>
               <RichText.Content value={attributes.contentUS}/>
              </p>
             <RichText.Content value={attributes.contentUT}/>
            </div>
           <RichText.Content value={attributes.contentUU}/>
          </div>
         <RichText.Content value={attributes.contentUV}/>
        </div>
       <RichText.Content value={attributes.contentUW}/>
      </div>
    );
  },
});
